(Num 6:23 JPS)'Speak unto Aaron and unto his sons, saying: On this wise ye shall bless the children of Israel; ye shall say unto them:
(Num 6:24 JPS)The LORD bless thee, and keep thee;
(Num 6:25 JPS)The LORD make His face to shine upon thee, and be gracious unto thee;
(Num 6:26 JPS)The LORD lift up His countenance upon thee, and give thee peace.
(Num 6:27 JPS)So shall they put My name upon the children of Israel, and I will bless them.'
